import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importáljuk a Bootstrap stíluslapot

const Layout = () => {
  return (
    <>
      <section>
        <nav className='navbar navbar-expand-lg navbar-light bg-light'>
          <Link to="/" className='navbar-brand'>Your Brand</Link>
          <button className='navbar-toggler' type='button' data-toggle='collapse' data-target='#navbarNav' aria-controls='navbarNav' aria-expanded='false' aria-label='Toggle navigation'>
            <span className='navbar-toggler-icon'></span>
          </button>
          <div className='collapse navbar-collapse' id='navbarNav'>
            <div className='navbar-nav'>
              <Link to="/" className='nav-item nav-link'>Home</Link>
              <Link to="/galeria" className='nav-item nav-link'>Gallery</Link>
              <Link to="/productlist" className='nav-item nav-link'>Product List</Link>
              <Link to="/tablazat" className='nav-item nav-link'>Tablazat</Link>
              <Link to="/timer" className='nav-item nav-link'>Timer</Link>
              <Link to="/cart" className='nav-item nav-link'>Cart</Link>
            </div>
          </div>
        </nav>
      </section>
      <Outlet />
    </>
  );
};

export default Layout;
